VALUES ('3366760023107', 'Assortiment asiatique, la barquette de', '4 samossas boeuf 25 (galettes de ble garnies a base de viande de boeuf), 4 beignets de crevette 20g (queues de crevette enrobees avec une pâte à beignet), 4 nems porc (galettes de riz garnies à base de viande de porc) + 1 sauce nuoc mam et 1 sauce aigre douce Ingredients Samossas boeuf : Galette 34.5% (eau, farine de BLF huile de tournesol. blanc dOEUF, sel, émulsifiant : lécithine de colza à, oignon, viand de bœuf 16.4% (origine France), vermicelles de pois rehydratés, proteine et amidon de BLE (dont SULFITES), huile de tournesol, sucre, féc de manioc, curry 0.7% (dont MOUTARDE), sel, arômes (dont BLE), curcuma. Beignets de crevette CREVETTE (CREVETTE, sel) (contient SULFITES), eau, fécule de pomme de terre, farine de BLE, huile de tournesol, poudres levantes (E450i, E500ii, BLE), amidon de BLF amidon modifié de pomme de terre, sel, sucre, OEUF entier poudre. épaississants (E412, E407, E415), curcuma. Nems porc : Galette 44% (eau, farine de riz, huile de tournesol, sel), viande de porc 18.3% (origine UE), vermicelles de pois réhydrates, oignon, carotte, germes de haricot mungo, farine de SOJA, gras de porc 3%, champignon noir réhydrate, menthe, sel, arôme (dont BLE). poivre. Sauce nuoc mam : Eau, sucre, nuoc mam 14% (POISSON, sel), vinaigre, sel. Sauce aigre douce : Eau, sucres, vinaigre, ananas, amidon modifié de maïs, poivron, sel, huile de tournesol, acidifiant : acide citrique. épic (curry (MOUTARDE), gingembre), stabilisants : gomme guar, gomme xanthane. Traces possibles de céleri, lait, mollusque, fruit à coque. Conseils de préparation : Au four : Prechauffer le four 10 minutes à 2000C (th 6/7) et réchauffer 10 à 15 minutes en les retournant a rm- cuisson. A consommer immédiatement après ouverture Conditionné sous atmosphère protectrice. Poids net : 340g', '', '10.7', '1.9', '23.7', '5.8', '', '7.8', '1.7', '0.669291338582677', '', '0');

