INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651002928', 'XXL Poulet Kebab Crudités sauce Blanche', 'Pain de mie complet (52 %) : farine complète de _blé_, eau, farine de _blé_, huile de colza, levure, sucre, sel, _gluten_ de blé, farine de fèves, émulsifiant : E471, antioxydant : acide ascorbique. Garniture (48 %) : poulet traité en salaison mariné façon kebab 46 % : viande de cuisse de poulet, eau, épices et aromates 0,8 %, sel, stabilisants : E451, arômes, amidon transformé de pomme de terre, dextrose, gélifiant : carraghénanes, chapelure de _blé_, tomate, sucre brun, colorant : extrait de paprika. Crudités 27 % : tomate, salade. Sauce _yaourt_ 27 % : huile de colza, eau, _yaourt_ 1 %, vinaigre d\'alcool, huile d\'olive, amidon transformé de pomme de terre, sucre, poudre de jaune d\'_oeuf_, sel, stabilisants : farine de graines de caroube et gomme xanthane, conservateur : sorbate de potassium.', 'https://static.openfoodfacts.org/images/products/336/765/100/2928/front.5.400.jpg', '8.2', '1.2', '24.2', '2.5', '', '8.9', '1.2', '0.47244094488189', '', '0');

