INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651002959', 'Be Wrappy Poulet Rôti, Tomates Marinées, Sauce Pesto', 'GARNITURE (53%) : Filet de poulet rôti traité en salaison 42% (filet de poulet, eau, acidifiants : lactate et acétate de potassium, dextrose, amidon transformé de pomme de terre, sel, stabilisant E451, sucre brun, antioxydant : érythorbate de sodium). Sauce au fromage blanc au pesto 28% (_fromage_ blanc, huile de colza, eau, vinaigre, basilic 0.6%, amidons transformés de pomme de terre, huile d\'olive vierge extra 0.3%, sel, moutarde de Dijon [eau, _graine de moutarde_, vinaigre, sel, acidifiant : acide citrique, conservateur : _disulfite_ de potassium], jaune d\'_œuf_, sucre, jus de citron concentré, _parmesan_, pignons de pin, épaississants : gomme de guar et xanthane, conservateur : sorbate de potassium, ail 0.02%, épice). Tomates marinées 15% (tomates semi-déshydratées, huile de colza, sel, origan, ail). Salade 15%. GALETTE DE BLÉ À LA TOMATE (47%) : farine de _blé_, eau, huile de colza, poudres à lever: E450-E500, tomate 0.4%, dextrose, sirop de glucose, sel, acidifiant E296, herbes et épices, extrait de paprika, légumes déshydratés (oignon, ail).', 'https://static.openfoodfacts.org/images/products/336/765/100/2959/front.7.400.jpg', '6.9', '0.9', '28', '3.9', '', '9.8', '1.19888', '0.472', '', '0');

